const styles = (theme) => ({
  searchMaxWidth: {
    minWidth: '45% !important',
    width: '50% !important',
    marginLeft: '1% !important',
  },
  filterBox: {
    height: '30px',
    display: 'flex',
    alignItems: 'center',
  },
  radioLabel: {
    marginTop: '0px !important',
  },
  viewLabel: {
    marginTop: '8px!important',
    fontWeight: 800,
    marginRight: '1.5rem',
  },
  selectAutocomplete: {
    '& .MuiInputBase-root': {
      height: '32px',
      alignContent: 'center',
      marginRight: '32px',
    },
  },
});

export default styles;
